        public GlyphIcon(GlyphStandard value, string name, string cssName) : base(IconType.GlyphIcon, (int)value, name, cssName)
        {
        }


        public override string ToClass(FontScale scale)
        {
            switch (scale)
            {
                case FontScale.Small:
                    return "glyphicons-" + base.CssName + " x05";
                case FontScale.x2:
                    return "glyphicons-" + base.CssName + " x2";
                case FontScale.x3:
                    return "glyphicons-" + base.CssName + " x3";
                case FontScale.x4:
                    return "glyphicons-" + base.CssName + " x4";
                case FontScale.x5:
                    return "glyphicons-" + base.CssName + " x5";
                case FontScale.Default:
                default:
                    return "glyphicons-" + base.CssName;
            }
        }
    }
